% --- Executes on button press in play.
function play_Callback(hObject, eventdata, handles)
% hObject    handle to play (see GCBO)
% eventdata  reserved - to be defined in a future version of MATLAB
% handles    structure with handles and user data (see GUIDATA)
global tunes tunes_harmonic fs rect_bar can_play melody
try
    if ~can_play  
        msgbox("Cannot play the song now!", "ERROR");
        return
    end
    can_play = false; % other song cannot be played now
    songpaths = get(handles.songpath, 'string');
    songpaths = strsplit(songpaths, ',');
    for i = 1: 1: length(songpaths)
        file = loadjson(songpaths{i});
        song = file.song;
        beat = str2double(get(handles.beat, 'string'));
        if i == 1
            melody = get_melody(tunes, tunes_harmonic, fs, song, beat);
        else 
            melody_temp = 1 / 2 * get_melody(tunes, tunes_harmonic, fs, song, beat);
            if length(melody_temp) < length(melody)
                melody_temp = [melody_temp; zeros(length(melody) - length(melody_temp), 1)];
            elseif length(melody_temp) > length(melody)
                melody = [melody; zeros(length(melody_temp) - length(melody), 1)];
            end
            melody = melody + melody_temp;
        end
        melody = melody / max(melody);
    end
catch error
    msgbox(error.message, 'ERROR');
    can_play = true;
    return 
end
axes(handles.wav);
plot([0 : length(melody) - 1] / fs, melody);
set(gca, 'XLim', [0  (length(melody) - 1) / fs]);
set(gca, 'YLim', [-1.5  1.5]);
% plot progress bar
axes(handles.progress); 
line([0,1,1,0], [0,0,1,1], 'Color', 'k', 'EraseMode', 'none');
try
    set(rect_bar,'XData',[0 0 0 0]);
catch
end
rect_bar = patch([0,1,1,0], [0,0,1,1], 'b', 'EdgeColor', 'b', 'EraseMode','none');
TotalTime = length(melody) / fs;
time = 0;
set(handles.progress, 'XTick', [], 'YTick', []);
sound(melody, fs);
while time < TotalTime
    set(rect_bar, 'XData', [0 time / TotalTime time / TotalTime 0]);
    drawnow;
    pause(1);
    time = time + 1;
end
can_play = true;


